    var Elegance = [Elegancee1, Elegancee2, Elegancee3, Elegancee4, Elegancee5, Elegancee6, Elegancee7];
    var Lena = [[Lenae1o1,Lenae1o2],[Lenae2o1,Lenae2o2],LenaCover,[Lenae3o1,Lenae3o2],[Lenae4o1,Lenae4o2],[Lenae5o1,Lenae5o2],Lenae6,[Lenae7o1,Lenae7o2],[Lenae8o1,Lenae8o2], Lenae9, [Lenae10o1,Lenae10o2], [Lenae11o1,Lenae11o2], [Lenae12o1,Lenae12o2]];
